import React, { Component } from 'react'
import UserConsumer from '../Context'

export default class AnaSayfa extends Component {
  constructor(props){
    super(props);
    this.state={
      id:''
    };
  }
  componentDidMount(){
    console.log('b');
      <UserConsumer>
      {
        value=>{
          this.setState({
            id:value.ogrenci.id
          })
          console.log(this.id)
        }
      }
    </UserConsumer>
  }
  render() {
    return (
      <UserConsumer>
        {
          value=>{
            const {ogrenci}=value;
            return(
              <div className='col' > 
                <br/>
                <h3  >Duyurular{
                  ogrenci.id!==""?
                  console.log(ogrenci.id+"Anasayfa")
                  :null
                }</h3>
                <hr/>
              </div>
            )
          }
        }
      </UserConsumer>
      
    )
  }
}
